import {
  Interview
} from '@/model/interview'
import PositionDetail from '@/view/position/position-detail'
import moment from 'moment'
export default {
  components: {
    PositionDetail,
  },
  data() {
    return {
      resultshow: false,
      time: '',
      flag: true,
      showPositionDetail: false,
      tableData: [],
      totalNums: 0,
      currentPage: 1,
      pageCount: 10,
      refreshPagination: true,
      showPositionID: 0,
      resultData: {
        time: undefined,
        address: '',
        memo: '',
        status: 0,
      },
    }
  },
  async created() {
    this.loading = true
    this.getByUserId()
    this.loading = false
  },
  methods: {
    getstatus() {
      return (this.resultData.status == 3) ? "error" : "success"
    },
    onClose() {
      this.resultData = {
        time: undefined,
        address: '',
        memo: '',
        status: 0,
      }
      this.time = ''
    },
    showMessage(row) {
      this.resultshow = true
      this.resultData = row
      this.time = this.resultData.time ? moment(this.resultData.time).format('北京时间 YYYY年MM月DD日 HH:mm:ss') : '';
    },
    editClose() {
      this.showPositionDetail = false
      this.$router.push("/box/wait")
    },
    handleShow(val) {
      this.showPositionDetail = true
      this.showPositionID = val.id
    },
    async getByUserId() {
      const page = this.currentPage - 1
      const count = this.pageCount
      // 待处理：state=0
      const applications = await Interview.getByUserId(this.$store.getters.user.id, 0,page,count)
      this.tableData = applications.items
      this.totalNums = applications.total
    },
    // 切换table页
    async handleCurrentChange(val) {
      this.currentPage = val
      this.loading = true
      this.getByUserId()
      this.loading = false
    },

  },
}
